function format_record_(record)
{
	var text = '';
	text += '<hr />';
	text += '<div>';
	{
		{ // area
			var cluster_id = record[0];
			var area_id = record[1];
			var name = record[2];
			text += '<a href="' + cluster_id + '.html#a' + area_id + '">' + name + '</a>';
		}
		text += ' @ ';
		{ // cluster
			var clusters = get_clusters_();
			var cluster_id = record[0];
			var name = clusters[cluster_id];
			text += '<a href="' + cluster_id + '.html">' + name + '</a>';
		}
	}
	text += '</div>';
	return text;
}

function do_travel_()
{
	try {
		var text = '';
		{
			var records = get_records_();
			var index = Math.floor(Math.random() * records.length);
			var record = records[index];
			text += format_record_(record);
		}
		set_result_(text);
	} catch (error) {
		set_result_('<hr />Error: ' + error);
	}
}

function on_travel()
{
	set_result_('<hr />移動中...');
	setTimeout(do_travel_, 1);
}
